import styles from './contact/contact.module.css';
export default function Contact() {
    return (
        <div id="mySidenav" class="sidenav" className={styles.mySidenav}>
            <a href="#" id="about">
                About
            </a>
            <a href="#" id="blog" className={styles.blog}>
                Blog
            </a>
            <a href="#" id="projects">
                Projects
            </a>
            <a href="#" id="contact">
                Contact
            </a>
        </div>
    );
}
